import React from 'react'
import { Wrapper } from './style'

const students = [{
    name:"Abhiraj",
    rollno:"01"
},
{
    name:"Naveen",
    rollno:"02"
}
]

const ClassIA = () => {

  return (
    <Wrapper>
      <input type="button" value="Mark" /> <input type="button" value="View" />
    {
        students.map((student) => 
        <div key={student.rollno}>
          
            <div className = 'field'>
                {student.rollno} {student.name} 
            </div>
            </div>)
    }
    </Wrapper>
  )
}

export default ClassIA
